import React from "react";
import {Question_count} from './Question_count';
import {Question_text} from "./Question_text";
import {Answer_section} from "./Answer_section";

export const Question_section = (props: { currentQuestion: number; questions: string | any[]; handleAnswerOptionClick: any; }) => {
    return (<div className='question-section'>
    <Question_count currentQuestion={props.currentQuestion} questions={props.questions}/>
    <Question_text currQuestions={questions}/>
    <Answer_section currQuestions={props.questions} handleAnswerOptionClick={props.handleAnswerOptionClick}/>
  </div>);
};
